export default function Card({id,name,image,type}){
    console.log(type)
    return(
        <div>
            <Link to={`/home${id}`}>
            <h3>{name}</h3>
            <img src={image} alt="imagen no encontrada" width="250px"/>
            </Link>
            <h5>{type.map(el=>el)}</h5>
        </div>
    )
}
